import React, { useState, useEffect} from 'react';
import './resume_result.css'
import { useLocation, useNavigate } from 'react-router-dom';
import axios from "axios";

const ResumeResult = (props) => {


  const location = useLocation();

  const [Keyword, setKeyword] = useState("")
  const [responseNum, setResponseNum] = useState(null);
  const [resumeList, setResumeList] = useState(null);

    const callApi = async()=>{
      try {
        const response = await axios.get("/api/resume_result",{params: {keyword: location.state.keyword} },
        { withCredentials: true } );

        console.log(location.state);
        setResponseNum(response.data.length);
        setResumeList(response.data);
        if(response.data.code == 404)
        { console.log(response.data.reason); }
        //console.log(response.data.resumeList);

      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };


    const callApi2 = async()=>{
      try {
        const response = await axios.get("/api/resume_result",{params: {keyword: Keyword} },
        { withCredentials: true } );

        console.log(Keyword);
        setResponseNum(response.data.length);
        setResumeList(response.data);
        //console.log(response.data.resumeList);

      } catch (error) {
        console.error("Error fetching data:", error);
      }

    };

    useEffect(()=>{
      callApi();
    }, []);

    const navigate = useNavigate();

    const handleLogout = () => {
      navigate('/');
    };
    const handleHome = () => {
      navigate('/home', {state: location.state.email});
      //navigate('/home');
    };
    const handleSearchResume = () => {
      navigate('/searchResume');
    };
    const handleSearchNotice = () => {
      navigate('/searchNotice');
    };
    // const handleResume = () => {
    //   navigate('/resume');
    // };
    // const handleNotice = () => {
    //   navigate('/notice');
    // };

    const handleSelectResume = (index) => {
      navigate('/selectedResume', { state: resumeList[index].email});
    };

    const handleResumeResult = () => {
      callApi2();
      //navigate('/resumeResult');
    };

    // const handleNextPage = () => {
    //   navigate('/resumeResult');
    // };
    // const handlePrevPage = () => {
    //   navigate('/resumeResult');
